import { link } from 'fs';
import React, { useEffect } from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title, logoPath, links } }: Props) => {

  const RenderLinks = () => {
    return (
      links.map(
        (l) => {
          return (
            <div>
              {l}
            </div>
          )
        }
      )
    )
  }

  return (
    <>
      <div>
        <img className="" src={logoPath} alt="logo" />
        <div>{title}</div>
        <div><RenderLinks /></div>
      </div>
    </>
  )
}

export default Sidebar;
